import React, { useState } from 'react'
import Navbar from '../../componentes/Navbar';
import { useNavigate } from 'react-router-dom';
import APIInvoke from '../../utils/APIInvoke';

const CrearProveedor = () => {

    const navigate = useNavigate();

    const [proveedor, setProveedor] = useState({
        pCiudad: '',
        pDireccion: '',
        pNombre: '',
        pTelefono: '',
        pNit: ''
    });

    const { pCiudad, pDireccion , pNombre, pTelefono, pNit } = proveedor;

    const onChange = (e) => {
        setProveedor({
            ...proveedor,
            [e.target.name]: e.target.value
        })
    }

    const nuevoProveedor = async () => {
        const data = {
            pCiudad: proveedor.pCiudad,
            pDireccion: proveedor.pDireccion,
            pNombre: proveedor.pNombre,
            pTelefono: proveedor.pTelefono,
            pNit: proveedor.pNit
        }

        const response = await APIInvoke.invokePOST(`/api/proveedor/`, data);

        const idProveedor = response.id;

        if(idProveedor === ''){
            alert("Ha ocurrido un error al crear un proveedor")
        }else{
            alert("Creacion exitosa")
        }

        setProveedor({
            pNit: '',
            pNombre: '',
            pCiudad: '',
            pTelefono: '',
            pDireccion: ''
        })
    }

    const onSubmit = (e) => {
        e.preventDefault();
        nuevoProveedor();
    }

    return (
        <section className="container">
            <Navbar />

            <div className="row align-items-center mb-4">
                <span className="fw-bold w-auto">Creacion de Proveedor</span>
            </div>
            <div className="divider" />
            <div className="row">
                
                <form onSubmit={onSubmit}>
                    <div className="mb-3">
                        <label htmlFor="proveedor-id">Id</label>
                        <input type="text" className="form-control" id="proveedor-id" name="proveedor-id" readOnly />
                    </div>
                    <div className="mb-3">
                        <label htmlFor="pNit">Documento</label>
                        <input value={pNit} onChange={onChange} required type="text" className="form-control" id="pNit" name="pNit" />
                    </div>
                    <div className="mb-3">
                        <label htmlFor="pNombre" className="form-label">Nombre</label>
                        <input value={pNombre} onChange={onChange} type="text" className="form-control" id="pNombre" name="pNombre" />
                    </div>
                    <div className="mb-3">
                        <label htmlFor="pCiudad">Ciudad</label>
                        <input value={pCiudad} onChange={onChange} type="text" className="form-control" id="pCiudad" name="pCiudad" />
                    </div>
                    <div className="mb-3">
                        <label htmlFor="pTelefono" className="form-label">Número Telefónico</label>
                        <input value={pTelefono} onChange={onChange} type="number" className="form-control" id="pTelefono" name="pTelefono" />
                    </div>
                    <div className="mb-3">
                        <label htmlFor="pDireccion" className="form-label">Dirección</label>
                        <input value={pDireccion} onChange={onChange} type="text" className="form-control" id="pDireccion" name="pDireccion" />
                    </div>
                    <button type="submit" className="btn btn-primary">Guardar</button>
                </form>
            </div>
        </section>

    );
}
export default CrearProveedor;
